style.css:
@-moz-document domain("polycul.es") {
a,
a:visited,
a:active,
a:hover {
    color: #39ce83;
}
body {
    background-color: #16161D;
    color: #cccccc;
}
#graph {
    box-shadow: none;
    border: 2px solid #333333;
}
input,
button {
    border: 1px solid #333333;
    background-color: #16161D;
    color: #cccccc;
}
#graph .link line {
    stroke: rgba(255, 255, 255, 0.25);
}
.id {
    fill: #cccccc !important;
}
}
